  console.log(item.item.name);
  return (
    <>
      <div className={style.BasketPrewiewItemWrapper}>
        <div className={style.BasketPrewiewImgWrapper}>
          <img src={process.env.REACT_APP_API_URL + item.item.img[0]} />
        </div>
        <div>
          {item.item.name}
          {item.count}шт.
        </div>
      </div>
    </>
  );
};
